CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_CONSUME_CONTAINER`(containerId int, consume double)
BEGIN
	DECLARE maxConsume double;
    DECLARE actualWeight double;
    DECLARE dishId int;
	
	SELECT 
		capacity
	INTO maxConsume FROM
		containers
	WHERE
		id = containerId;
		
	SELECT 
		actual_weight
	INTO actualWeight FROM
		containers_status
	WHERE
		container_id = containerId
	ORDER BY updated_at DESC
	LIMIT 1;
    
	SELECT 
		dish_id
	INTO dishId FROM
		containers_status
	WHERE
		container_id = containerId
	LIMIT 1;
    
    IF(consume > maxConsume)
    THEN
		-- RETURN BECAUSE ITS MORE THAN THE MAXCONSUME
		SELECT 2 as 'STATUS','Error, because its more than the max consume enabled.' as 'MESSAGE';
    ELSE
        IF(consume > actualWeight)
        THEN
			-- RETURNS 3 IF IS MORE THAN THE ACTUAL WEIGHT
            SELECT 3 as 'STATUS','Error, because its more than the actual weight.' as 'MESSAGE';
        ELSE
			INSERT INTO containers_status
			VALUES(0,(actualWeight - consume),containerId,dishId,NOW(),NOW());
            -- RETURNS 0 IF THE OPERATION IS SUCCESFULLY
            SELECT 0 as 'STATUS','SUCCESS.' as 'MESSAGE';
        END IF;
    END IF;
END ;;
